[[package]]
name = "cloudpickle"
version = "2.0.0"
description = "Extended pickling support for Python objects"
category = "main"
optional = false
python-versions = ">=3.6"

[[package]]
name = "doit"
version = "0.34.1"
description = "doit - Automation Tool"
category = "main"
optional = false
python-versions = ">=3.6"

[package.dependencies]
cloudpickle = "*"
macfsevents = {version = "*", markers = "sys_platform == \"darwin\""}
pyinotify = {version = "*", markers = "sys_platform == \"linux\""}

[package.extras]
plugins = ["setuptools"]
toml = ["toml (>=0.10.1)"]

[[package]]
name = "entrypoints"
version = "0.4"
description = "Discover and load entry points from installed packages."
category = "main"
optional = false
python-versions = ">=3.6"

[[package]]
name = "jupyter-core"
version = "4.9.1"
description = "Jupyter core package. A base package on which Jupyter projects rely."
category = "main"
optional = false
python-versions = ">=3.6"

[package.dependencies]
pywin32 = {version = ">=1.0", markers = "sys_platform == \"win32\" and platform_python_implementation != \"PyPy\""}
traitlets = "*"

[[package]]
name = "jupyterlite"
version = "0.1.0a21"
description = "tools for building JupyterLite sites"
category = "main"
optional = false
python-versions = ">=3.7"

[package.dependencies]
doit = "*"
entrypoints = "*"
jupyter_core = ">=4.7"

[package.extras]
all = ["jsonschema (>=3)", "jupyter-server", "jupyter-server-mathjax (>=0.2.3)", "jupyterlab (>=3.0,<4)", "jupyterlab_server (>=2.8.1,<3)", "pkginfo", "tornado (>=6.1)"]
check = ["jsonschema[format_nongpl] (>=3)"]
contents = ["jupyter-server"]
lab = ["jupyterlab (>=3.1,<4)"]
mathjax = ["jupyter-server-mathjax (>=0.2.3)"]
piplite = ["pkginfo"]
serve = ["tornado (>=6.1)"]
test = ["ansi2html", "diffoscope", "pytest-console-scripts", "pytest-cov", "pytest-html", "pytest-xdist"]
translation = ["jupyterlab_server (>=2.8.1,<3)"]

[[package]]
name = "macfsevents"
version = "0.8.1"
description = "Thread-based interface to file system observation primitives."
category = "main"
optional = false
python-versions = "*"

[[package]]
name = "pyinotify"
version = "0.9.6"
description = "Linux filesystem events monitoring"
category = "main"
optional = false
python-versions = "*"

[[package]]
name = "pywin32"
version = "303"
description = "Python for Window Extensions"
category = "main"
optional = false
python-versions = "*"

[[package]]
name = "traitlets"
version = "5.1.1"
description = "Traitlets Python configuration system"
category = "main"
optional = false
python-versions = ">=3.7"

[package.extras]
test = ["pytest"]

